import React from 'react'
import './Hamburger.scss'
const Hamburger = (props) => {
	return (
		<div class="menu-wrap">
      <input type="checkbox" onClick={()=>setChecked(!checked)}class="toggler"/>
      <div class="hamburguer">
      <div></div>
      </div>
    </div>
	)
}

export default Hamburger
